INSERT INTO `global_property` VALUES ('FormEntry.enableDashboardTab','true','true/false whether or not to show a Form Entry tab on the patient dashboard','f88e1b91-ea1f-464e-bfe9-bcc56f2f601e'),('FormEntry.enableOnEncounterTab','false','true/false whether or not to show a Enter Form button on the encounters tab of the patient dashboard','d7400052-2016-4e20-abe6-8ba8e2dee6c3'),('concept.causeOfDeath','5002','Concept id of the concept defining the CAUSE OF DEATH concept','422fe762-8dd8-11e1-be2c-e1d7904ed235'),('concept.cd4_count','5497','Concept id of the concept defining the CD4 count concept','422fe9f6-8dd8-11e1-be2c-e1d7904ed235'),('concept.false','1066','Concept id of the concept defining the FALSE boolean concept','bb7ab552-f524-4b5e-bec7-9ad6e414bdc4'),('concept.height','5090','Concept id of the concept defining the HEIGHT concept','422feb0e-8dd8-11e1-be2c-e1d7904ed235'),('concept.medicalRecordObservations','1238','The concept id of the MEDICAL_RECORD_OBSERVATIONS concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.','422fec08-8dd8-11e1-be2c-e1d7904ed235'),('concept.none','1107','Concept id of the concept defining the NONE concept','422fed20-8dd8-11e1-be2c-e1d7904ed235'),('concept.otherNonCoded','5622','Concept id of the concept defining the OTHER NON-CODED concept','422fee24-8dd8-11e1-be2c-e1d7904ed235'),('concept.patientDied','1742','Concept id of the concept defining the PATIEND DIED concept','422fef1e-8dd8-11e1-be2c-e1d7904ed235'),('concept.problemList','1284','The concept id of the PROBLEM LIST concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.','7abb7992-5e49-48a8-8577-b061a42f1541'),('concept.reasonExitedCare','6153','Concept id of the concept defining the REASON EXITED CARE concept','422ff02c-8dd8-11e1-be2c-e1d7904ed235'),('concept.reasonOrderStopped','6098','Concept id of the concept defining the REASON ORDER STOPPED concept','422ff11c-8dd8-11e1-be2c-e1d7904ed235'),('concept.true','1065','Concept id of the concept defining the TRUE boolean concept','28880ba0-291f-4ad7-b9a2-498050002b12'),('concept.weight','5089','Concept id of the concept defining the WEIGHT concept','422ff20c-8dd8-11e1-be2c-e1d7904ed235'),('concepts.locked','false','true/false whether or not concepts can be edited in this database.','422ff2fc-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.encounters.showEditLink','true','true/false whether or not to show the \'Edit Encounter\' link on the patient dashboard','422ff3f6-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.encounters.showEmptyFields','true','true/false whether or not to show empty fields on the \'View Encounter\' window','422ff4fa-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.encounters.showViewLink','true','true/false whether or not to show the \'View Encounter\' link on the patient dashboard','422ff5fe-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.encounters.usePages','smart','true/false/smart on how to show the pages on the \'View Encounter\' window.  \'smart\' means that if > 50% of the fields have page numbers defined, show data in pages','422ff70c-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.encounters.viewWhere','newWindow','Defines how the \'View Encounter\' link should act. Known values: \'sameWindow\', \'newWindow\', \'oneNewWindow\'','422ff810-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.header.programs_to_show','','List of programs to show Enrollment details of in the patient header. (Should be an ordered comma-separated list of program_ids or names.)','3ba348f7-7ed9-451f-bfdd-ddfec587a627'),('dashboard.header.workflows_to_show','','List of programs to show Enrollment details of in the patient header. List of workflows to show current status of in the patient header. These will only be displayed if they belong to a program listed above. (Should be a comma-separated list of program_workflow_ids.)','0f4d8023-121c-4a7c-900f-0327fc34a2ce'),('dashboard.overview.showConcepts','','Comma delimited list of concepts ids to show on the patient dashboard overview tab','422ff914-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.regimen.displayDrugSetIds','ANTIRETROVIRAL DRUGS,TUBERCULOSIS TREATMENT DRUGS','Drug sets that appear on the Patient Dashboard Regimen tab. Comma separated list of name of concepts that are defined as drug sets.','422ffa0e-8dd8-11e1-be2c-e1d7904ed235'),('dashboard.regimen.displayFrequencies','7 days/week,6 days/week,5 days/week,4 days/week,3 days/week,2 days/week,1 days/week','Frequency of a drug order that appear on the Patient Dashboard. Comma separated list of name of concepts that are defined as drug frequencies.','5fd6d20e-2b97-47b9-8a5e-36db07291ccc'),('dashboard.regimen.standardRegimens','<list>  <regimenSuggestion>    <drugComponents>      <drugSuggestion>        <drugId>2</drugId>        <dose>1</dose>        <units>tab(s)</units>        <frequency>2/day x 7 days/week</frequency>        <instructions></instructions>      </drugSuggestion>    </drugComponents>    <displayName>3TC + d4T(30) + NVP (Triomune-30)</displayName>    <codeName>standardTri30</codeName>    <canReplace>ANTIRETROVIRAL DRUGS</canReplace>  </regimenSuggestion>  <regimenSuggestion>    <drugComponents>      <drugSuggestion>        <drugId>3</drugId>        <dose>1</dose>        <units>tab(s)</units>        <frequency>2/day x 7 days/week</frequency>        <instructions></instructions>      </drugSuggestion>    </drugComponents>    <displayName>3TC + d4T(40) + NVP (Triomune-40)</displayName>    <codeName>standardTri40</codeName>    <canReplace>ANTIRETROVIRAL DRUGS</canReplace>  </regimenSuggestion>  <regimenSuggestion>    <drugComponents>      <drugSuggestion>        <drugId>39</drugId>        <dose>1</dose>        <units>tab(s)</units>        <frequency>2/day x 7 days/week</frequency>        <instructions></instructions>      </drugSuggestion>      <drugSuggestion>        <drugId>22</drugId>     