8-08 00:00:00',NULL,NULL,'41ecb0b4-8dd8-11e1-be2c-e1d7904ed235'),(1286,1292,'Deep venous thrombosis is a condition where there is a blood clot in a deep vein (a vein that accompanies an artery).','en',1,'2006-04-22 00:00:00',NULL,NULL,'41ed9f60-8dd8-11e1-be2c-e1d7904ed235'),(1287,1293,'A chronic condition in which the lower esophageal sphincter allows gastric acids to reflux into the esophagus, causing heartburn, acid indigestion, and possible injury to the esophageal lining.','en',1,'2006-04-22 00:00:00',NULL,NULL,'41eda1cc-8dd8-11e1-be2c-e1d7904ed235'),(1288,1294,'Infection of the spinal fluid and meninges secondary to cryptococcus.','en',1,'2006-04-22 00:00:00',NULL,NULL,'41eda79e-8dd8-11e1-be2c-e1d7904ed235'),(1289,1295,'Umbrella term for a group of respiratory tract diseases that are characterized by airflow obstruction or limitation (ie, emphysema)','en',1,'2006-04-22 00:00:00',NULL,NULL,'41edaa6e-8dd8-11e1-be2c-e1d7904ed235'),(1290,1296,'Generic descriptive diagnosis that includes many non-specific dermatitidies.','en',1,'2006-04-22 00:00:00',NULL,NULL,'41edb18a-8dd8-11e1-be2c-e1d7904ed235'),(1291,1297,'Bilirubin is a breakdown product of hemoglobin. Total and direct bilirubin are usually measured to screen for or to monitor liver or gall bladder dysfunction.','en',1,'2006-06-02 00:00:00',NULL,NULL,'41edb2fc-8dd8-11e1-be2c-e1d7904ed235'),(1292,1298,'Very Low Density Lipoprotein (VLDL) is one of three major lipoprotein particles.  VLDL contains the highest amount of triglyceride. Since VLDL contains most of the circulating triglyceride and since the compositions of the different particles are relatively constant, it is possible to estimate the amount of VLDL cholesterol by dividing the triglyceride value (in mg/dL) by 5.','en',1,'2006-06-02 00:00:00',NULL,NULL,'41edb8ba-8dd8-11e1-be2c-e1d7904ed235'),(1293,1299,'To diagnose pancreatitis or other pancreatic diseases','en',1,'2006-06-05 00:00:00',NULL,NULL,'41edc080-8dd8-11e1-be2c-e1d7904ed235'),(1294,1300,'Descriptive term:  open to two or more interpretations; or of uncertain nature or significance.','en',1,'2006-06-05 00:00:00',NULL,NULL,'41edc648-8dd8-11e1-be2c-e1d7904ed235'),(1295,1301,'Descriptive term:  to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 00:00:00',NULL,NULL,'41edd1ce-8dd8-11e1-be2c-e1d7904ed235'),(1296,1302,'Descriptive term:  unable to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 00:00:00',NULL,NULL,'41edd7be-8dd8-11e1-be2c-e1d7904ed235'),(1297,1303,'Descriptive term:  restrictive of action.','en',1,'2006-06-05 00:00:00',NULL,NULL,'41edd8cc-8dd8-11e1-be2c-e1d7904ed235'),(1298,1305,'This is a qualitative result for the number of copies/ml of DNA/RNA in patients with HIV.','en',1,'2006-06-05 00:00:00',NULL,NULL,'41edd9e4-8dd8-11e1-be2c-e1d7904ed235'),(1299,1306,'Descriptive Term:  beyond detectable limit.','en',1,'2006-06-05 00:00:00',NULL,NULL,'41eddb42-8dd8-11e1-be2c-e1d7904ed235'),(1300,1307,'Mean platelet volume (MPV) is a machine-calculated measurement of the average size of your platelets. New platelets are larger, and an increased MPV occurs when increased numbers of platelets are being produced. MPV gives your doctor information about platelet production in your bone marrow.','en',1,'2006-06-06 00:00:00',NULL,NULL,'41eddc50-8dd8-11e1-be2c-e1d7904ed235'),(1301,1308,'A measurement derived from the platelet count and the mean platelet volume.','en',1,'2006-06-06 00:00:00',NULL,NULL,'41edddae-8dd8-11e1-be2c-e1d7904ed235'),(1302,1309,'Derived from direct flow cytometric measurement of platelet cell volume, it is increased in the presence of platelet anisocytosis.','en',1,'2006-06-06 00:00:00',NULL,NULL,'41eddec6-8dd8-11e1-be2c-e1d7904ed235'),(1303,1310,'Percentage of t-cells which express the CD3 surface receptor.','en',1,'2006-06-06 00:00:00',NULL,NULL,'41eddfe8-8dd8-11e1-be2c-e1d7904ed235'),(1304,1318,'Quantitative cut-off result for initial HIV screening test','en',1,'2006-06-06 00:00:00',NULL,NULL,'41ede0f6-8dd8-11e1-be2c-e1d7904ed235'),(1305,1319,'Immunology Test - CD45 plus lymphocyte count.','en',1,'2006-06-06 00:00:00',NULL,NULL,'41ede204-8dd8-11e1-be2c-e1d7904ed235'),(1306,1326,'Qualitative interpretation of rapid HIV screening test 2.','en',1,'2006-06-07 00:00:00',NULL,NULL,'41ede312-8dd8-11e1-be2c-e1d7904ed235'),(1307,1327,'Help determine if the bone marrow is responding adequately to the body?s need for RBCs and to help determine the cause of and classify different types of anemia.\r\n\r\nReticulocyte (%) = [Number of Reticulocytes / Number of Red Blood Cells] X 100','en',1,'2006-06-09 00:00:00',NULL,NULL,'41ede42a-8dd8-11e1-be2c-e1d7904ed235'),(1308,1328,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ','en',1,'2006-06-09 00:00:00',NULL,NULL,'41ede542-8dd8-11e1-be2c-e1d7904ed235'),(1309,1330,'Absolute neutrophil count (ANC) is a measure of the number of neutrophil granulocytes (also known as polymorphonuclear cells, PMN\'s, polys, granulocytes, segmented neutrophils or segs) present in the blood. Neutrophils are a type of white blood cell that fights against infection.\r\n\r\nANC = (%neutrophils + %bands) x WBC','en',1,'2006-06-09 00:00:00',NULL,NULL,'41ede664-8dd8-11e1-be2c-e1d7904ed235'),(1310,1331,'A monocyte count is part of a complete blood count and is expressed by absolute numbers.  Increase a monocyte count include: - chronic inflammation - stress response - hyperadrenocorticism - immune mediated disease - pyogranulomatous disease - necrosis - red cell regeneration.\r\n','en',1,'2006-06-09 00:00:00',NULL,NULL,'41ede786-8dd8-11e1-be2c-e1d7904ed235'),(1311,1332,'Eosinophil granulocytes, commonly referred to as eosinophils (or less commonly as acidophils), are white blood cells that are responsible for combating infection by parasites in the body.\r\n\r\n','en',1,'2006-06-09 00:00:00',NULL,NULL,'41ede89e-8dd8-11e1-be2c-e1d7904ed235'),(1312,1333,'Basophils are the least common of the granulocytes, representing about 0.5% to 1% of circulating leukocytes. ','en',1,'2006-06-09 00:00:00',NULL,NULL,'41ede9c0-8dd8-11e1-be2c-e1d7904ed235'),(1313,1334,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ','en',1,'2006-06-09 00:00:00',NULL,NULL,'41edead8-8dd8-11e1-be2c-e1d7904ed235'),(1314,1336,'Type of white blood cell which forms an early line of defence against bacterial infections by using microscopic exam','en',1,'2006-06-09 00:00:00',NULL,NULL,'41edebf0-8dd8-11e1-be2c-e1d7904ed235'),(1315,1337,'Immature neutrophils with a crescent shaped nucleus, bands are normal in the circulation in small numbers. If there is a percentage increase of them, there is said to be a left shift. This may happen when an acute infection stimulates increased neutrophils production.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'41eded08-8dd8-11e1-be2c-e1d7904ed235'),(1316,1338,'Agranulocytic leukocyte that normally makes up about 25% of the total white blood cell count but increases in the presence of infection.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'41edee2a-8dd8-11e1-be2c-e1d7904ed235'),(1317,1339,'Large, circulating, phagocytic white blood cells, having a single well-defined nucleus and very fine granulation in the cytoplasm. Monocytes constitute from 3 to 8 percent of the white blood cells in humans.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'41edef4c-8dd8-11e1-be2c-e1d7904ed235'),(1318,1340,'A type of white blood cell found in vertebrate blood, containing cytoplasmic granules that are easily stained by eosin or other acid dyes.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'41edf05a-8dd8-11e1-be2c-e1d7904ed235'),(1319,1341,'Type of leukocyte, with coarse granules that stain blue when exposed to a basic dye. Basophils normally constitute 1% or less of the total white blood cell count but may increase or decrease in certain diseases.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'41edf186-8dd8-11e1-be2c-e1d7904ed235'),(1320,1342,'Body Mass Index (BMI) is a relationship between weight and height that is associated with body fat and health risk.\r\n\r\nThe equation is BMI = body weight in kilograms/height in meters squared.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edf32a-8dd8-11e1-be2c-e1d7904ed235'),(1321,1343,'MUAC is the circumference of the left upper arm, measured at the mid-point between the tip of the shoulder and the tip of the elbow.  MUAC is useful for the assessment of nutritional status.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edf532-8dd8-11e1-be2c-e1d7904ed235'),(1322,1344,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edf6d6-8dd8-11e1-be2c-e1d7904ed235'),(1323,1345,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edf87a-8dd8-11e1-be2c-e1d7904ed235'),(1324,1346,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edfa46-8dd8-11e1-be2c-e1d7904ed235'),(1325,1347,'Anatomic location.\r\n','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edfbea-8dd8-11e1-be2c-e1d7904ed235'),(1326,1348,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edfdca-8dd8-11e1-be2c-e1d7904ed235'),(1327,1349,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41edff64-8dd8-11e1-be2c-e1d7904ed235'),(1328,1350,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41ee00ea-8dd8-11e1-be2c-e1d7904ed235'),(1329,1351,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41ee039c-8dd8-11e1-be2c-e1d7904ed235'),(1330,1352,'Estimation of body fat by skinfold thickness measurement.','en',1,'2006-07-13 00:00:00',NULL,NULL,'41ee05c2-8dd8-11e1-be2c-e1d7904ed235'),(1331,5002,'Describes a person\'s cause of death.. Coded answer.','en',1,'2004-08-12 00:00:00',NULL,NULL,'41ee0856-8dd8-11e1-be2c-e1d7904ed235'),(1332,5003,'Patient\'s identifica