INSERT INTO `htmlformentry_html_form` VALUES (1,5,NULL,'<htmlform>\r\n	<macros>\r\n		paperFormId = MoH257\r\n		headerColor =#009d8e\r\n		fontOnHeaderColor = white\r\n	</macros>\r\n\r\n	<style>\r\n		.section {\r\n			border: 1px solid $headerColor;\r\n			padding: 2px;\r\n			text-align: left;\r\n			margin-bottom: 1em;\r\n		}\r\n		.sectionHeader {\r\n			background-color: $headerColor;\r\n			color: $fontOnHeaderColor;\r\n			display: block;\r\n			padding: 2px;\r\n			font-weight: bold;\r\n		}\r\n		table.baseline-aligned td {\r\n			vertical-align: baseline;\r\n		}\r\n	</style>\r\n\r\n	<span style=\"float:right\">Paper Form ID: $paperFormId</span>\r\n	<h2>Adult Return Clinic Visit (v0.1)</h2>\r\n\r\n	<section headerLabel=\"Clinic Visit\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td>UPN: <lookup class=\"value\" complexExpression=\"#foreach( $patId in $patientIdentifiers.get(\'UPN\') ) $patId #end \"/></td>\r\n				<td>Name: <lookup class=\"value\" expression=\"patient.personName\"/></td>\r\n				<td>OpenMRS ID: <lookup class=\"value\" complexExpression=\"#foreach( $patId in $patientIdentifiers.get(\'OpenMRS Identification Number\') ) $patId #end \"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td>Location: <encounterLocation/></td>\r\n				<td>Provider: <encounterProvider/></td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n\r\n	<section headerLabel=\"Individual Visitation Details\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td colspan=\"2\">Date: <encounterDate default=\"today\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"5089\" labelText=\"Weight (kg):\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"5085\" labelText=\"Blood Pressure:\"/>/<obs conceptId=\"5086\" labelText=\"\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"5090\" labelText=\"Height (cm):\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"1342\" labelText=\"BMI:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"5088\" labelText=\"Temperature:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td rowspan=\"2\">Pregnancy</td>\r\n				<td><obs conceptId=\"5272\" style=\"checkbox\" labelText=\"Status\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"5596\" allowFutureDates=\"true\" labelText=\"EDD:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td rowspan=\"2\">FP status</td>\r\n				<td><obs conceptId=\"5271\" style=\"checkbox\" labelText=\"FP/No FP:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"374\" labelText=\"FP method:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td rowspan=\"2\">Tuberculosis Status</td>\r\n				<td><obs conceptId=\"5965\" labelText=\"Status:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"1270\" labelText=\"TBRx:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"1069\" labelText=\"Potential side effects:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"6110\" labelText=\"New OIs:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"6112\" labelText=\"Other problems:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"5356\" labelText=\"WHO stage:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td rowspan=\"2\">Cotrimoxazole</td>\r\n				<td><obs conceptId=\"6113\" labelText=\"Adherence:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"1263\" labelText=\"Dispensed:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"1264\" labelText=\"INH dispensed:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"1193\" labelText=\"Other medications dispensed:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td rowspan=\"2\">ARV drugs</td>\r\n				<td><obs conceptId=\"6118\" labelText=\"Adherence:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"6119\" labelText=\"Why poor/fair:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td rowspan=\"5\">Laboratory Investigations Done</td>\r\n				<td><obs conceptId=\"5497\" labelText=\"CD4:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"21\" labelText=\"Hgb:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"299\" labelText=\"RPR:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"307\" labelText=\"TB sputum:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td><obs conceptId=\"1271\" labelText=\"Other:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"1272\" labelText=\"Referral/Hospitalized:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"6131\" labelText=\"At Risk Population:\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\"><obs conceptId=\"5096\" allowFutureDates=\"true\" labelText=\"Date of Next Appointment:\"/></td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n	<submit/>\r\n</htmlform>\r\n									\r\n								',4,'2012-04-24 17:45:31',4,'2012-04-24 18:55:22',0,'52c83db6-0994-4677-946d-83063f9535e3',NULL,NULL,NULL,NULL);
